import React from 'react'
import { useNavigate } from 'react-router-dom'
import './Home.css'
import AccountIcon from "./images/account.svg"

export default function Home() {
  const navigate = useNavigate()

  const onSubscriptClick = () => {
    navigate('/subscriptions')
  }

  const onRequestClick = () => {
    navigate('/request')
  }

  const onFutureClick = () => {
    navigate('/future')
  }

  const onScheduleClick = () => {
    navigate('/schedule')
  }

  const onHistoryClick = () => {
    navigate('/history')
  }

  return (
    <>
      <div className={'mainContainer'}>
        <div className={'topContainer'}>
          <div className={'welcomeContainer'}>
            <p>Welcome to Jarvis Automotive Services!</p>
          </div>
          <div className={'accountContainer'}>
            <image className={'accountButton'} src={AccountIcon} onClick={onSubscriptClick} width="40px" height="40px"/>
          </div>
        </div>
        <div className={'homeContainer'}>
          <button className={'homeButton'} onClick={onRequestClick} >Request a Ride Now</button>
        </div>

        <div className={'homeContainer'}>
          <button className={'homeButton'} onClick={onFutureClick} >Request a Ride in the Future/button</button>
        </div>

        <div className={'homeContainer'}>
          <button className={'homeButton'} onClick={onScheduleClick} >View Scheduled Rides</button>
        </div>

        <div className={'homeContainer'}>
          <button className={'homeButton'} onClick={onHistoryClick} >Ride History</button>
        </div>
      </div>
    </>
  )
}
